import React from 'react';

const Card = () => {

    return (
        <div className="bg-light-green dib br3 pa3 ma2 grow">
            <img alt="robtos" src="https://robohash.org/e?size=200x200"></img>
            <div>
                <h2>Name</h2>
                <p>Name@email.com</p>
            </div> 
        </div>
    );

}

export default Card;
